import React from 'react';
import "./products.css";
import Oculos01 from '../img/oculos01.png'
import Oculos02 from '../img/oculos02.png'
import Oculos03 from '../img/oculos03.png'
import Oculos04 from '../img/oculos04.png'

function Product() {
    return (  

            <section className='product-container'>
              <div className='limitar-secao content-container'>
              
              <div className='cards'> <img src={Oculos01}/>  </div>
              <div className='cards'> <img src={Oculos02}/></div>
              <div className='cards'> <img src={Oculos03}/>Card 03</div>
              <div className='cards'> <img src={Oculos04}/>Card 04</div>
               

               </div>
            </section>

    );
}

export default Product

 
;
